textOriginal:
Bozó é como o Satanás,  tudo o que diz é mentindo.
Se fala em Deus, é nentindo e  a mentira é símbolo do demônio; 
Se fala em pátria,  é mentindo e um patriota jamais seria expulso do exercito por malandragem como ele foi;
Se fala em família,  é mentindo. Um bom pai de família, jamais ensinaria sua mulher e seus filhos a roubarem;
 Se fala em honestidade,  é mentindo. Uma pessoa honesta, jamais precisaria de 100 anos de sigilo para esconder seus maus costumes;
Se pede desculpas,  é mentindo. Já o vi prometendo inúmeras vezes coisas que ele diz que faz e não faz.  É só lembrar das urnas eletrônicas e ver o que ele diz ensultando as instituições da República. 
Em resumo: ele é aquilo que seus devotos querem, o MITO... o  MITOmaniaco...
